import AboutUs from './AboutUs'
import Blog from './Blog'


function App() {
  return (
    <AboutUs title_section="ABOUT EIGHT SEC" introduce_section="There are many variations of passages of Lorem Ipsum available,....">
      <AboutTheme icon="fa fa-desktop" title="WordPress" text="There are many variations of passages of " />
      <AboutTheme icon="fa fa-pencil" title="Design" text="There are many variations of passages of " />
      <AboutTheme icon="fa fa-lightbulb-o" title="Analytics" text="There are many variations of passages of " />
      <AboutTheme icon="fa fa-camera" title="Progamming" text="There are many variations of passages of " />   
    </AboutUs>
  )
}

export default App;
